react/week-19/lesson.html.body:
React 1

What will we learn today?

What is React?
What is a component?
Rendering with React
JSX
Let's Create a React App
React Components
Embedding JS into JSX
Key
Importing/Exporting Components
Making an Argument for Props
What Are Props?

What is React?
React is a JavaScript library created by Facebook. It is used for making complex, interactive user interfaces. It has become very popular in the last 5 years.
Why has it become so popular?

It is fast and efficient
It is easy to understand & less verbose than "vanilla" JS api
It helps separate functionality into small, understandable pieces

What is a component?
React heavily relies on a concept called "components". Components are like small Lego blocks for designing and developing user interfaces. They can be stuck together in different ways to create new UI.
Let's have a look at an example: the GitHub header. What are the logical "pieces" of UI? What could be a component?

Here we've highlighted some elements that could be components:

Component tips
There are no hard & fast rules for making components. UIs can be split up into components in many different ways, requiring judgement based on your context.

Components should follow the Single Responsibility Principle
Each component should only have 1 "responsibility"
Should only do 1 thing


Components should have good, explicit names
This helps you to remember what the component's job is




Exercise A:
Look at the example online shopping user interface in the Thinking in React article (the image at the top). Draw boxes around the components and give them names. Compare with the example components shown in the second image.

Rendering with React
Remember how annoying it was to manage the DOM yourself in our previous lesson? The "vanilla" JavaScript APIs for updating the DOM are quite long and difficult to remember. React makes this easier by manipulating each DOM element itself, instead of you doing it manually. You give React a "description" of the DOM that you want and it will update the DOM for you. React abstracts away the management of the DOM.
Let's take a look at an example. We are going to walk through how to render a  with the text "Hello World" within it.
First, lets recap how we could do this using "vanilla" JS (interactive version):






  var divNode = document.createElement('div');
  divNode.innerText = 'Hello World';

  var rootElement = document.querySelector('#root');
  rootElement.appendChild(divNode);




Now let's convert to using React (interactive version):












  const element = React.createElement('div', {
    children: 'Hello World'
  });

  const rootElement = document.querySelector('#root');
  ReactDOM.render(element, rootElement);




JSX
As you can see, React is already helping us a bit by cleaning up some of the verbose vanilla JS APIs. However in a typical React application you would still use a lot of the React.createElement function. To improve the developer experience the React team developed JSX.
JSX is a simple syntax sugar that looks like HTML, but is actually converted to the React.createElement function when you run it.
Using JSX (interactive version):











  const element = Hello World;

  const rootElement = document.querySelector('#root');
  ReactDOM.render(element, rootElement);





As you can see, this is much easier to read than both the straight React.createElement API and the vanilla JS API. Most people using React use JSX to write their components.

Exercise B
Change the JSX example from above to instead render a h1 tag with the text "Hello Code Your Future".

Let's Create A React App
The Facebook team behind React have created a tool to help you create and set up React projects. It is called Create React App. It sets up files like we saw in the previous example, so that you don't have to.

Exercise C: Install & set up a Create React App by following the steps below

npm install -g create-react-app

create-react-app pokedex
cd pokedex
npm start
The last command should open a web browser for you. This shows the application that we are going to be working on. Open the pokedex directory in your editor. Notice that create-react-app has created a bunch of folders for you. We will be working with the pokedex application for the rest of the module.
React Components
We looked at the beginning of the lesson at the concept of components. Now let's look at how components are made in React.
import React from 'react';
import ReactDOM from 'react-dom';

function HelloWorld() {
  return (
    Hello World
  );
}

ReactDOM.render(, document.querySelector('#root'));

There are 3 important parts in this code:

First we import React. This is important because JSX is converted to React.createElement calls. If the React variable is undefined then this will fail.
We create a React component called HelloWorld.
We render the HelloWorld component into a div with the id of root.


Exercise D:
Using the pokedex React app that you just created and open the src/App.js file

Delete everything in the file except the line containing export default App. You should see an error in your terminal and in your web browser - don't panic! We're going to remake the App component ourselves
Import React variable from the React package
Create a function named App, which will be our component
Within the App function, return a  element with the text "Welcome to the Pokedex". What do you see in your web browser?
Create a  element that wraps around the  you just created
Below the  element (but within the ), create an  element. Then make its src attribute equal to https://assets.pokemon.com/assets/cms2/img/pokedex/full/016.png. What do you expect to see in your web browser?
Now create a  element to wrap both the  element and the  element


Component Composition
A component can be combined with another component so that both are rendered. This is called composition (interactive example):
function Greeting() {
  return Hello;
}

function Mentor() {
  return Ali;
}

function HelloWorld() {
  return (




  );
}

In the HelloWorld component we are using a reference to the Greeting and Mentor components. React reads these references when rendering HelloWorld and so it renders the Greeting and Mentor child components.
We are also using some shorter syntax within the HelloWorld component.  is just a shorter way of writing , which is useful if we don't need to put anything inside the Greeting component.
Notice how the components that we write (HelloWorld, Greeting, Mentor) are written using a camel case convention and always start with an uppercase letter? And "regular DOM" components (div, span) are always lowercase? This the convention to let you know whether you are using a "regular DOM component" or a component that you have written.

Exercise E:
Using the pokedex React app that you created earlier and open the src/App.js file

Create a new function named Logo
Copy  element and its contents and paste into the Logo component
Replace the  element in the App component with the new Logo component
Create a new component function named BestPokemon and return a  element with some text saying which is your favourite Pokemon (e.g. "My favourite Pokemon is Squirtle")
Render your new BestPokemon component below the Logo component within the App component


Arrow Functions for shorter syntax
Because a React component is just a function, we can also use the arrow function syntax:
const HelloWorld = () => {
  return (
    Hello World
  );
}

This can be even shorter again if we use parentheses and implicit return:
const HelloWorld = () => (
  Hello World
);

Although this is shorter, it is less flexible as we cannot insert code that is not JSX. Like for example, a console.log:
// THIS DOES NOT WORK!
const HelloWorld = () => (
  console.log('Hello!')
  Hello world
);

If we want to do this, we can still use arrow functions but we can't use the implicit return.

Exercise F:
Using the pokedex React app that you created earlier and open the src/App.js file
Convert the Logo and BestPokemon functions into an arrow functions

Embedding JavaScript into JSX
So far all of the components we have looked at haven't been able to change - they are hard-coded. But this doesn't make very interesting websites, we want to be able to use variables with different data. We can insert variables (and some other things) into our React components.
Anything that is inside curly braces ({ and }) is interpreted as a regular JavaScript expression. That means you can use every object or function from JavaScript that we have learned so far. Let's look at an example (interactive example):
const Greeting = () => {
  const greetingWord = 'Hello';
  return (
    {greetingWord}
  );
}

Now instead of hard-coding the greeting in the Greeting component, we are using a variable. Remember that everything between the curly braces is just regular JavaScript. So we can use more than just variables (interactive example):
const Mentor = () => {
  const mentors = ['Ali', 'Kash', 'Davide', 'German', 'Gerald'];
  return (
    {mentors.join(', ')}
  );
};

Now we have modified the Mentor component to use the Array.join method so that it lists several mentor's names. This also works with other JS types:
const Addition = () => {
  return {1 + 2 + 3};
};

const Weather = () => {
  const weatherData = {
    temperature: 5,
    location: 'London'
  };
  return The temperature in {weatherData.location} is {weatherData.temperature};
};

function formatName(user) {
  return user.firstName + ' ' + user.lastName
}

const Name = () => {
  const user = {
    firstName: 'Bob',
    lastName: 'Marley'
  };
  return {formatName(user)};
};

A common pattern in React is to use Array.map to loop through a list of items and render a component for each one (interactive example):
const mentors = ['Ali', 'Kash', 'Davide', 'German', 'Gerald'];

const List = () => (

    {mentors.map((name) => {
      return (
        {name}
      );
    })}

);

Here we are using Array.map to turn an array of strings into an array of components.

Exercise G:
Using the pokedex React app that you created earlier and open the src/App.js file

Inside the Logo component create a new variable called appName and assign it to "Pokedex"
Now replace the hard-coded app name with {appName}. What do you see in your web browser? What would you do if you wanted to change the app name?
Create a new component named CaughtPokemon. Within this component return a  tag with the text "Caught 0 Pokemon on" (we're going to fill in today's date in the next step)
Create a variable named date within the CaughtPokemon component, and assign it today's date (hint: new Date().toLocaleDateString()). Finally, render the date variable after the text "Caught 0 Pokemon on"
Render the CaughtPokemon component within the App component (below BestPokemon)
Within the BestPokemon component, create a variable named pokemonNames and assign it to an array with some Pokemon names (e.g. ['Squirtle', 'Bulbasaur', 'Charmander'])
Change the BestPokemon component to return a  element instead of a  element
Now use the .map() method on the pokemonNames variable to loop over each name and return a  element for each (hint: look at the mentors list example above)


Keys
You may have noticed that we are now seeing a red error message in the Dev Tools: Warning: Each child in a list should have a unique "key" prop.. This error happens when you use Array.map to return a list of elements (interactive example):
const mentors = ['Ali', 'Kash', 'Davide', 'German', 'Gerald']

const List = () => (

    {mentors.map((name, index) => {
      return {name};
    })}

);

Here we have added a key prop to the li element. A documentation page explaining in more depth is in the further reading section but basically the key prop has a special meaning in React because it is used internally to keep track of which element in the list is which.
Importing/Exporting Components
To help organise your code, components can be imported and exported just like any other JavaScript code (interactive example):
import Greeting from './Greeting';
import Mentor from './Mentor';

const HelloMentor = () => (




);

We also need to export our components if we want to use them in other files:
const Greeting = () => (
  Hello
);

export default Greeting;

The convention is to name component files the exactly same as the component (including the capital letter).

Exercise H:
Using the pokedex React app that you created earlier

Create a new file within the src directory named Logo.js
Copy and paste the Logo component from App.js into Logo.js
Remember to add import React from 'react' at the top of Logo.js
Export the Logo component from Logo.js (hint: look at the Greeting example above)
Delete the old Logo component from App.js
Import the Logo component into App.js (hint: look at the HelloMentor example above)
Repeat this process with the BestPokemon and CaughtPokemon components. What do you think the files should be called?


Making an Argument for Props
What's the problem with our HelloMentor component above?
The component HelloMentor is very static. What if we want to say hello to a different mentor? Currently, we would have to change the code too! This is easy in our tiny application but for "real" applications this might be more difficult.
Instead wouldn't it be good if we could change which mentor we are saying hello to every time we render the component? So we could reuse the HelloMentor component for different mentor names. This is what props are for.
What Are Props?
Props are what we use in React to pass "arguments" to components. They are very similar to arguments in functions - you can "pass" props to components, and you can use those props within a component.
First let's look at passing props to your components (interactive example):


As you can see props are key-value pairs, in this example the key is name and the value is the string 'Mozafar'. We can pass as many props as we like to a component.
We don't have to use strings, we can use any valid JavaScript data like numbers, arrays and objects. Remember that in JSX you can use curly braces ({ & }) to inject data that is not a string:


Now let's take a look at using props that we have passed to a component (interactive example):
const Mentor = (props) => {
  console.log(props);
  return (
    {props.name}
  );
};

React gives you access to props in the first argument to the component function. We can then inject props into our component using curly braces.
The props variable is just a normal object with key-value pairs that match what was passed to the component. Because it is just a variable, it can be used like any other variable. That includes injecting props into attributes:
{props.name}

Or calculating new values:
{props.age + 1}


Exercise I
Using the pokedex React app that you created earlier

Open the App.js file
Pass a prop appName="Pokedex" to the Logo component
Now open the Logo.js file
Delete the appName variable. What do you see in your web browser? Why?
Change the Logo function to access the first argument and call it props. Use console.log to inspect the props variable
Change the usage of appName in the  to be props.appName instead. Does this fix the problem? Why?
Now open the BestPokemon.js file
Copy the pokemonNames variable and then delete it
Paste the pokemonNames variable into App.js
Pass the pokemonNames variable as a prop to BestPokemon
In the BestPokemon.js file replace the existing usage of pokemonNames with the pokemonNames prop. You should still see the Pokemon names in your web browser
(STRETCH GOAL) Repeat the process with the date variable in the CaughtPokemon.js file


Further Reading
Fed up of having to provide a prop for every component? Do you want to make your component use a value most of the time, but it can be overridden with a prop? This is a good time to use defaultProps. This page on the React documentation describes in more detail.

Exercise J
Complete the FreeCodeCamp exercises on defaultProps:

Use Default Props
Override Default Props


Credits
Inspiration & examples for this module were taken from Kent C. Dodd's Beginner's Guide to ReactJS course.
Homework

If you haven't already, complete the in-class exercises on your pokedex app
Complete all of the lesson 1 exercises in the cyf-hotel-react project

Prepare for the next class

Follow the official React tutorial (up to the "Completing the Game" section)
Watch the Beginner's Guide to ReactJS on Egghead.io

react/week-20/lesson.html.body:
React 2

What will we learn today?

Recap
Class Components
Passing Functions as Props
Reacting to Changes
State

Recap
Last week we looked at how to write a HelloMentor React component (interactive example):
// Greeting.js
const Greeting = () => (
  Hello
);

// Mentor.js
const Mentor = (props) => (
  {props.name}
);

// index.js
import Greeting from './Greeting';
import Mentor from './Mentor';

const HelloMentor = () => (




);

Class Components
So far we have looked at components which are just functions (which are called functional components), but there is another way of creating React components using the class keyword. Let's look at an example (interactive example):
import React, { Component } from 'react';

// Class component
class Greeting extends Component {
  render() {
    return (
      Hello
    );
  }
}

// Functional component
const Greeting = () => {
  return (
    Hello
  )
};

Instead of getting props through the first argument of the component function, the class component gets props from this.props:
class Mentor extends Component {
  render() {
    return (
      {this.props.name}
    );
  }
}

So when do we use the class keyword and when do we use function components? Class components have special super powers called state and lifecycle (which we will look at later). The rule of thumb is to use functional components, unless you need to use the special super powers of state or lifecycle.
Here are the steps to follow to convert from a functional component into a class component:

Import the Component variable by changing the React import to: import React, { Component } from 'react';
Create a new class that extends the component: class MyComponentName extends Component {}
Inside the class, create a render method: render() {}
Copy and paste the contents of the functional component into the render method
Replace any references to props with this.props
Delete the old functional component


Exercise A
Open the pokedex React application that you created last week

Convert the Logo component from a functional component into a class component
Convert the CaughtPokemon component into a class component
Convert the BestPokemon component into a class component


Class Methods
One of the super powers that class components have is how we can add more functions within the class scope. These are called methods (interactive example):
import React, { Component } from 'react';

class Hello extends Component {
  sayHello = () => {
    console.log('Hello from Hello component!');
  }

  render() {
    return (
      Say hello
    );
  }
}

Notice how we use a slightly different syntax for the sayHello method than the render method? There is a reason for this, but it is quite complicated and mostly irrelevant. The rule of thumb is to always use this syntax:
methodName = () => {
  // ...
}

Except for the render method (and a handful of others which we'll talk about later).

Exercise B
Open the pokedex React application and open the Logo.js file

Add a method named logWhenClicked to the Logo component (hint: remember to use the correct syntax)
Within the logWhenClicked method, console.log a message (it doesn't matter what the message is)
Add a onClick handler to the  that will call this.logWhenClicked (hint: look at the Hello component above)
In your web browser, try clicking on the image. What do you see in the JavaScript console?


Passing Functions as Props
Remember that functions in JavaScript are "first class" - that means we can pass a reference to a function (as a variable) and then call it elsewhere.
function hello() {
  return 'Hello!';
}

In the example above hello is a reference to a function. The functions are not called until we use parentheses:
console.log(hello);   // Logs: "ƒ hello() {}"
console.log(hello()); // Logs: "Hello!"

This is important in React as we can pass the reference to the function as a prop, and then call the function from the child component (interactive example):
class App extends Component {
  logWhenClicked = () => {
    console.log('Button was clicked!');
  }

  render() {
    return (



    );
  }
}

const FancyButton = (props) => (

    Click Me!

);


Exercise C
Open the pokedex React application

Open the Logo.js component and copy the logWhenClicked method. Then delete it from the Logo component.
Change the onClick handler to this.props.handleClick
Paste the logWhenClicked method into the component in App.js
Then pass the logWhenClicked method as a prop to the Logo component (hint: look at the App example above)
Try clicking the image in your web browser again. Does it still work? Can you explain why to the person sitting next to you?


Reacting to Changes
Now let's write a more interesting app that responds to some user input. We'll see how React will take care of updating the DOM for you.
A counter is a common React example, showing the number of times a button has been clicked. First lets render a button and a counter which set to 0 clicks (interactive example):
let count = 0;

const Counter = (props) => (

    Count: {props.count}
    Click me!

);

function renderCounter() {
  ReactDOM.render(, document.getElementById('root'));
}

renderCounter(count);

Note that this example is simplified compared to your pokedex application. To keep the code clean, some parts are split into separate files. In the pokedex application, you'll find the ReactDOM.render call in index.js.
This example isn't very useful yet as it doesn't do anything when clicking the button. Now let's listen for clicks on the button and increment the counter (interactive version):
let count = 0

class Counter extends Component {
  // ...
}
function renderCounter(count) {
  // ...
}

renderCounter(count)

document.getElementById('click-me').addEventListener('click', () => {
  count = count + 1
  renderCounter(count)
})

As you can see, the DOM automatically updates when you render. This is an incredibly powerful feature of React. Even better, React will figure out exactly the right bits of the DOM that need to be changed. This makes it extremely efficient and fast. This is concept is called the "virtual DOM".
State
Let's take another look at the the counter example. What if you wanted to create multiple counters on the same page? How would you add another counter?
You could add some more count global variables:
let count1 = 0
let count2 = 0
let count3 = 0

What might be the problem here?

It's quite verbose
It's hard to make sure that you're updating the correct counter
It's stuck at 3 counters - to add more, we'd have to do more work

What other approaches can we take?
The solution that React provides for us is called state. It allows a component to "remember" some variables. Let's take a look at how we could rewrite the counter with React state.
Let's start over and get rid of the global variables. Generally having global variables is a bad idea, since it is very easy to create a bug which affects the whole application.
const Counter = (props) => {
  return (

      Count: {props.count}
      Click me!

  )
};

ReactDOM.render(, document.getElementById('root'));

Now we need to use one of the class component super powers - state. That means we'll have to convert our Counter component to use a class (interactive example):
class Counter extends Component {
  render() {
    return (

        Count: {this.props.count}
        Click me!

    );
  }
}

Next we'll change the component to use the count from this.state instead of this.props (interactive example):
class Counter extends Component {
  render() {
    return (

        Count: {this.state.count}
        Click me!

    );
  }
}

This code has a bug! this.state is initialised as an empty object, and so this.state.count is undefined. We need to initialise it from props. We can do this in the class constructor (interactive example):
class Counter extends Component {
  constructor(props) {
    super(props);
    this.state = {
      count: props.count
    };
  }

  render() {
    // ...
  }
}

Now the counter component is "remembering" its count, however it is stuck at 0. Next we'll look at how we change what the component is remembering (interactive example):
class Counter extends Component {
  constructor(props) {
    // ...
  }

  increment = () => {
    this.setState({
      count: 1
    });
  }

  render() {
    return (

        Count: {this.state.count}
        Click me!

    );
  }
}

There's a couple of things happening here. We've added an click handler to the button, which will call the increment function when the button gets clicked. When the increment function is called, it calls this.setState function with the count set to 1.
this.setState is a special function provided by React's Component, and it is used to change what the component is "remembering". It will also tell React that the old value that is still shown in the DOM is outdated and needs to be updated. This will trigger React to re-render, like we did manually with the renderCounter function.
Now that we have refactored to use React state, we can easily add multiple counters (interactive example):
const App = () => {
  return (





  );
};

This still isn't a particular useful application, because we can only still only count to 1! We need to change our Counter component so that it reads the previous state, then adds 1 onto that. We can do this by passing a callback function to this.setState (interactive example):
class Counter extends Component {
  constructor(props) {
    // ...
  }

  increment = () => {
    this.setState(previousState => {
      return {
        count: previousState.count + 1
      };
    });
  }

  render() {
    // ...
  }
}

Now we can count up as many times as we like! 
So when do we need to use a callback function for this.setState? If we are computing the new state based on the old state, then we need to use a callback function. Otherwise we can just use an object. This is because React can 'delay' this.setState executing for performance reasons. By using a callback function, we ensure that we are computing the new state with the correct version of the old state and not an outdated one.
Let's recap what we've learnt about React state:

State is one of the class component super powers - you must use a class component to use state
We initialise state in the constructor method by assigning the this.state variable to an object with whatever initial state we want (e.g. { something: 'hello' })
We can read or render state by using the this.state variable (e.g. this.state.something)
We can change state using the this.setState() method and by passing the piece of state we want to update (e.g. this.setState({ something: 'hi' }))
If we need to read the previous state to be able to calculate the new state, then we must use a callback function with this.setState() (e.g. this.setState((previousState) => { return { something: previousState.something + 1 } }))


